import React, {useContext, Fragment} from 'react';
import EquipoContext from '../../context/proyectos/EquipoContext';

const MiEquipo = () => {

    //arreglo de nombres de equipos
    const equiposContext = useContext(EquipoContext);
    const { equipo, equipoActual, eliminarEquipo } = equiposContext;

    //Si no hay equipo seleccionado
    if(!equipo) return <h2>Selecciona un equipo</h2>

    //Array destructuring para extraer eñ equipo actual
    //const [equipoActual] = equipo;

    //Eliminar un equipo
    const onClickEliminar = () => {
        eliminarEquipo(equipoActual.id)
    }

    return (
        <Fragment>
            <div className="listado-proyectos">
                <h1>Nombre del equipo</h1>
                <h3>{equipoActual.nombre}</h3>
            </div>
            <button
                type="button"
                className="btn btn-eliminar"
                onClick={onClickEliminar}
            >Eliminar Equipo</button>
        </Fragment>
    );
}
export default MiEquipo;
